  \"2015-09-27T00:16:31.863903\",\n\t\"name\": \"physical-and-biological-data-collected-along-the-texas-mississippi-and-florida-gulf-coasts-in-t\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"HABSOS (Harmful Algal BloomS Observing
  System) is a data collection and distribution system for harmful algal bloom (HAB)
  information in the Gulf of Mexico. The goal of HABSOS is to provide environmental
  managers, scientists, and the public with a data driven resource for HAB events.
  Cell counts and environmental information are combined into a single product and
  distributed on a map powered by ArcGIS and visualized at http://service.ncddc.noaa.gov/website/AGSViewers/HABSOS/maps.htm.
  HABSOS strives to provide the most accurate picture of harmful algal bloom location
  and quantity by using the latest sample data available.nnPurpose: To give historical
  data about the presence of harmful algal blooms, based on cell count.nnData here
  contain data from Texas, Mississippi, and Florida, as well as data along the Florida
  Shelf in the Gulf of Mexico and along the eastern coast of Florida in the North
  Atlantic Ocean.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
